                "Futuryzm narodzi\u0142 si\u0119 we W\u0142oszech wraz z pocz\u0105tkiem XX-ego wieku. Jego pionierem by\u0142 Filippo Tommaso Marinetti, kt\u00F3ry opowiada\u0142 si\u0119 za szybko\u015Bci\u0105, technologi\u0105, rozwojem, patrzeniem w przysz\u0142o\u015B\u0107 (\u2018Rycz\u0105cy samoch\u00F3d pi\u0119kniejszy jest od Nike z Samotraki\u2019). Wkr\u00F3tce do\u0142\u0105czyli do niego malarze Umberto Boccioni, Carlo Carr\u00E0, Gino Severini, Giacomo Balla, Luigi Russolo. Pierwszy Manifest Futuryzmu ukaza\u0142 si\u0119 w czasopi\u015Bmie \u2018Le Figaro\u2019 w 1909 r. W p\u00F3\u017Aniejszych latach og\u0142aszano jeszcze inne wersje np. Manifest Techniki Malarstwa Futurystycznego (1910 r.). Prace futuryst\u00F3w zdaj\u0105 si\u0119 pod\u0105\u017Ca\u0107 z ruchem, oddawa\u0107 jego moc, wra\u017Cenie na p\u0142askiej powierzchni p\u0142\u00F3tna. Dostrzec w nich mo\u017Cemy dziedzictwo kubizmu, rozbicie na cz\u0119\u015Bci. S\u0105 niczym st\u0142uczony wazon, kt\u00F3ry w magiczny spos\u00F3b pr\u00F3buje posk\u0142ada\u0107 sam siebie. Na wielu dzie\u0142ach znajdziemy bezpo\u015Brednie odniesienie do maszyny, samochodu, samolotu. Futuryzm obj\u0105\u0142 swoim wp\u0142ywem wiele dziedzin, poprzez literatur\u0119, malarstwo, rze\u017Ab\u0119, teatr, taniec po mod\u0119 i architektur\u0119. Obecnie mo\u017Cemy m\u00F3wi\u0107 o zjawisku nazywanym neofuturyzmem. Jak pisze Urszula Pawlicka cz\u0142onkini grupy Rozdzielczo\u015B\u0107 Chleba w eseju ",
